import React from "react";
import {
  EmailShareButton,
  EmailIcon,
  FacebookShareButton,
  FacebookIcon,
  LinkedinShareButton,
  LinkedinIcon,
  TwitterShareButton,
  TwitterIcon,
} from "react-share";

function Header() {
  const shareUrl = 'https://engagementtracker.net'

  return (
    <div className="header">
      <div className="headerText">version 1</div>
        <LinkedinShareButton url={shareUrl} windowWidth="32" windowHeight="32" />
        <TwitterShareButton url={shareUrl} />
        <FacebookShareButton url={shareUrl} />
        <EmailShareButton url={shareUrl} />
    </div>
  );
}

export default Header;
